import './App.css';
import { useState } from 'react';



function Inputs() {
    return (
        <div>
            <input placeholder="Add your new TODO item..." />
            <button>Add</button>
        </div>
    );
}

function ListItem({todo}) {
    return (
        <li>
            {todo}
            Hi
        </li>
    );
}

function List({todos}) {
    const items = [];

    todos.forEach(todo => {
        items.push(<ListItem todo={todo} />);
    });

    return (
        <ul>{items}</ul>
    );
}

function TODOList({ todos }) {
    return (
        <div>
            <Inputs />
            <List
                todos={todos} />
        </div>
    );
}

const TODOS = ["Item1", "Clean", "Write", "Finish"]; // + finished

export default function App() {
    return (
        <TODOList todos={TODOS} />
    );
}
